INSERT [dbo].[Articles] ([Id], [EmployeeId], [CategoryId], [Title], [Contents], [PublishDate], [HideTime], [Status], [ImageURL]) VALUES (1, 1, 4, N'歡迎光臨我們的居酒屋', N'我們很高興宣布我們的居酒屋即將在明天開幕！歡迎大家來品嚐我們的新菜單，享受愉快的用餐時光。', CAST(N'2023-01-13' AS Date), NULL, 0, N'about-1.jpg')
GO
INSERT [dbo].[Articles] ([Id], [EmployeeId], [CategoryId], [Title], [Contents], [PublishDate], [HideTime], [Status], [ImageURL]) VALUES (2, 2, 1, N'春季新菜推薦', N'這個春季，我們引入了一系列令人垂涎的新菜品。從炸物到烤物，每一道菜都充滿豐富的風味。', CAST(N'2024-04-01' AS Date), CAST(N'2024-04-30T23:59:59.000' AS DateTime), 1, N'about-3.jpg')
GO
INSERT [dbo].[Articles] ([Id], [EmployeeId], [CategoryId], [Title], [Contents], [PublishDate], [HideTime], [Status], [ImageURL]) VALUES (3, 3, 2, N'清涼夏日，來杯特調冷酒', N'在炎熱的夏天，我們特別推薦清涼的特調冷酒。酒吧師傅為您調製，絕對是解渴的最佳選擇。', CAST(N'2024-01-05' AS Date), CAST(N'2024-01-20T23:59:59.000' AS DateTime), 1, N'about-2.jpg')
GO
INSERT [dbo].[Articles] ([Id], [EmployeeId], [CategoryId], [Title], [Contents], [PublishDate], [HideTime], [Status], [ImageURL]) VALUES (1012, 1, 4, N'歡慶開幕', N'感謝各位顧客的厚愛，我們很榮幸地宣布，台北店將於 2023/1/13 正式開業！在這個特別的日子裡，我們將舉辦一系列的活動和優惠，期待您的光臨。這裡是一個充滿著美味和歡笑的居酒屋，讓您感受到家的溫馨。
我們的菜單豐富多樣，包括各種新鮮食材製作而成的美味料理，以及精心挑選的飲品，為您帶來一場美味的饗宴。無論是和家人、朋友一起共度溫馨時光，還是在這裡舉辦小型聚會，都是我們的榮幸。
感謝您成為我們居酒屋大家庭的一員，讓我們一同分享美好時光。期待在台北店見到您！', CAST(N'2023-01-13' AS Date), NULL, 1, N'about-4.jpg')
GO
INSERT [dbo].[Articles] ([Id], [EmployeeId], [CategoryId], [Title], [Contents], [PublishDate], [HideTime], [Status], [ImageURL]) VALUES (1013, 1, 2, N'飲品介紹', N'在這裡，我們引以為傲的不僅僅是美味的料理，還有多樣精心調製的飲品。特別推薦我們獨家調製的招牌雞尾酒，每一口都是一場味蕾的盛宴。
我們的調酒師擁有豐富的經驗，將傳統和創新完美結合，為您呈現最令人難忘的飲品體驗。無論是單獨品味，還是與美味料理搭配，都能帶給您一場愉悅的味覺之旅。
歡迎讓我們一同享受美好時光！', CAST(N'2023-01-13' AS Date), NULL, 1, N'about-5.jpg')
GO
INSERT [dbo].[Articles] ([Id], [EmployeeId], [CategoryId], [Title], [Contents], [PublishDate], [HideTime], [Status], [ImageURL]) VALUES (1014, 2, 4, N'台中店開幕文', N'感謝大家的支持，我們很高興地宣布，台中店即將於 2023/6/13 開幕！這是一個充滿活力和獨特風情的居酒屋，我們期待與您一同分享美味和快樂。
在台中店，我們將繼續秉持著高品質的食材和獨特的料理風格，為您呈現一場美味的饗宴。無論是經典日式料理還是新奇創意的小吃，我們都致力於打造最滿足您味蕾的菜單。
開業當天，我們將舉辦一系列精彩的活動，包括限時優惠和精選節目，讓您感受到台中店的獨特魅力。敬請期待，期待在這個特別的日子裡與您相會！', CAST(N'2023-06-13' AS Date), CAST(N'2024-03-30T00:00:00.000' AS DateTime), 1, N'about-6.jpg')
GO
INSERT [dbo].[Articles] ([Id], [EmployeeId], [CategoryId], [Title], [Contents], [PublishDate], [HideTime], [Status], [ImageURL]) VALUES (1015, 2, 2, N'飲品介紹', N'我們引以為傲的不僅是美味的飲品，還有精心調製的特色調酒系列。無論您是愛好清新風味、濃郁口感還是狂熱於創新口味，我們的調酒師團隊將為您呈現一場真正的酒藝表演。
試試我們的「瑰麗夜宴」，一款綜合了清新水果和香醇威士忌的經典調酒，讓您在每一口中感受到層次豐富的風味。或者品嚐「夢幻草莓季」，融合了新鮮草莓和柔順的伏特加，為您帶來甜蜜愉悅的味蕾享受。
我們的調酒不僅是一種飲品，更是一種藝術和創意的表現。每一杯都是經過精心調製，呈現出獨特且難忘的口感。來到台中店，讓我們的調酒師為您帶來一場獨一無二的調酒之旅吧！', CAST(N'2024-01-01' AS Date), CAST(N'2024-01-31T00:00:00.000' AS DateTime), 1, N'about-7.jpg')
GO
INSERT [dbo].[Articles] ([Id], [EmployeeId], [CategoryId], [Title], [Contents], [PublishDate], [HideTime], [Status], [ImageURL]) VALUES (1016, 1, 1, N'夏季鮮美居酒屋', N'五月的微風中，我們為您呈現夏季鮮美的居酒屋料理。清涼解暑的生魚片、清爽的沙拉，以及獨特的日式涼拌菜，將為您的味蕾帶來一場清新的夏日饗宴。

推薦菜品：
1. 刺身拼盤 - 多種新鮮刺身，搭配芥末和醬油，清新可口。
2. 涼拌軟絲 - 清爽的軟絲，淋上特製的醬汁，是夏天的清涼佳品。
3. 涼拌茄子 - 日式涼拌茄子，酸甜可口，適合夏日消暑。
4. 凍釀生啤 - 特製的凍釀技術，為您帶來冰涼爽口的啤酒體驗。

歡迎來店品味夏季的鮮美居酒屋料理！', CAST(N'2023-05-01' AS Date), CAST(N'2023-06-30T00:00:00.000' AS DateTime), 1, N'about-8.jpg')
GO
INSERT [dbo].[Articles] ([Id], [EmployeeId], [CategoryId], [Title], [Contents], [PublishDate], [HideTime], [Status], [ImageURL]) VALUES (1017, 2, 4, N'台中店獨家新菜', N'我們在台中店為大家帶來了全新的獨家新菜，將傳統和創新完美結合，呈現出獨特的口味饗宴。精選的食材、巧妙的搭配，將為您帶來一場難忘的美食之旅。

推薦菜品：
1. 特色壽司 - 融合台中當地風味的特色壽司，讓您感受到在地美食的獨特魅力。
2. 香煎鮭魚配柚子醬 - 鮮嫩的鮭魚搭配清新的柚子醬，口感豐富。
3. 特調果汁 - 以台中在地水果製作的特調果汁，清新又美味。

歡迎來到台中店，一同品味我們的獨家新菜！', CAST(N'2023-04-01' AS Date), CAST(N'2023-04-30T00:00:00.000' AS DateTime), 1, N'about-9.jpg')
GO
INSERT [dbo].[Articles] ([Id], [EmployeeId], [CategoryId], [Title], [Contents], [PublishDate], [HideTime], [Status], [ImageURL]) VALUES (1018, 1, 1, N'冬季居酒屋之旅', N'隨著十月的寒意，我們為您帶來冬季新菜的居酒屋風味。濃厚的湯品、香醇的燒烤，以及獨特的日式炸物，將讓您在冬日裡感受到居酒屋的溫暖。

推薦菜品：
1. 熱炸豆腐串 - 外酥內嫩的炸豆腐，搭配特製醬汁，是冬日居酒屋的必點之選。
2. 溫暖味噌湯 - 香濃的味噌湯，裡面夾帶著各種美味的海鮮和時蔬。
3. 和風烤鮭魚 - 日式烤鮭魚，表皮香脆，內裡鮮嫩多汁。

歡迎來店品味冬季的居酒屋美味！', CAST(N'2023-11-01' AS Date), CAST(N'2023-11-30T00:00:00.000' AS DateTime), 1, N'about-10.jpg')
GO
INSERT [dbo].[Articles] ([Id], [EmployeeId], [CategoryId], [Title], [Contents], [PublishDate], [HideTime], [Status], [ImageURL]) VALUES (1019, 1, 7, N'新會員專屬禮遇', N'歡迎加入我們的會員大家庭！為了感謝您的支持，我們特別準備了一份豐富的入會禮。只要您成為我們的會員，即可獲得精選禮品一份。讓我們一同分享美好時光，更多會員專屬優惠等您來享受。

入會禮內容：
1. 會員專屬紀念品
2. 折扣券一張
3. 會員積分加倍優惠

成為我們的會員，即享有這份豐盛的入會禮，期待在居酒屋的每一刻都能為您帶來愉快和驚喜。', CAST(N'2023-01-10' AS Date), NULL, 1, N'about-11.jpg')
GO
INSERT [dbo].[Articles] ([Id], [EmployeeId], [CategoryId], [Title], [Contents], [PublishDate], [HideTime], [Status], [ImageURL]) VALUES (1020, 1, 7, N'會員專屬加購優惠', N'親愛的會員朋友，為了回饋您一直以來的支持，我們推出了會員專屬加購優惠！凡是會員在指定時間內加購指定商品，即可享有超值折扣優惠。別錯過這個獨家優惠，讓您的居酒屋饗宴更加美味可口。

加購優惠內容：
1. 加購指定料理，享有額外9折優惠
2. 限定時間內有效
3. 詳細活動內容請洽詢服務人員

期待您能在會員專屬的加購優惠中，找到最愛的美味。謝謝您的支持，讓我們一同創造更多美好時光。', CAST(N'2023-03-15' AS Date), NULL, 1, N'about-12.jpg')
GO
INSERT [dbo].[Articles] ([Id], [EmployeeId], [CategoryId], [Title], [Contents], [PublishDate], [HideTime], [Status], [ImageURL]) VALUES (1021, 1, 5, N'新年新希望', N'在這美好的新年開始之際，居酒屋向您送上最誠摯的祝福！願新的一年充滿希望和喜悅，願您在這一年中事事順心、步步高升。感謝您一直以來的支持，我們期待在新的一年中繼續為您獻上美味和溫馨。

讓我們攜手迎接新的挑戰和機會，共同創造更美好的未來。祝您新年快樂，萬事如意！', CAST(N'2024-01-01' AS Date), CAST(N'2024-01-31T00:00:00.000' AS DateTime), 1, N'about-13.jpg')
GO
INSERT [dbo].[Articles] ([Id], [EmployeeId], [CategoryId], [Title], [Contents], [PublishDate], [HideTime], [Status], [ImageURL]) VALUES (1022, 1, 5, N'聖誕歡樂', N'居酒屋全體成員祝您聖誕快樂！在這個溫馨的節日裡，願您與家人朋友共度愉快時光。聖誕節是分享愛與溫暖的時刻，讓我們一同感受到節慶的喜悅。

感謝您一直以來的支持，居酒屋願您在這聖誕季節中擁有美好的回憶，期待新的一年繼續與您共度美好時光！', CAST(N'2023-12-25' AS Date), CAST(N'2023-12-31T00:00:00.000' AS DateTime), 1, N'about-14.jpg')
