INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (1, 1, N'涼拌毛豆', 50, N'LVXw8uY', N'https://i.imgur.com/LVXw8uY.jpg', N'涼拌毛豆不僅可以單獨享用，還是一個絕佳的啤酒或清酒小吃，讓您在品味美食的同時，搭配一杯您喜愛的酒品。', 1, 1)
