INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (2, 1, N'涼拌牛蒡絲', 50, N'r49s9yG', N'https://imgur.com/r49s9yG.jpg', N'涼拌牛蒡絲是一道清爽開胃的涼菜，特別適合在夏季或者作為開胃菜品嚐，也非常適合搭配清酒、或者其他您喜愛的酒品，為您的居酒屋體驗增添一絲美好。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (3, 1, N'涼拌洋蔥', 50, N'PLnsmdn', N'https://imgur.com/PLnsmdn.jpg', N'涼拌洋蔥以新鮮的洋蔥為主，經過適度的處理，保持了一定的脆度，搭配清爽的調味醬，味道清新爽口，適合作為開胃菜或者涼爽的小吃，也能夠搭配著清涼的啤酒一起品嘗。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (4, 1, N'醃蘿蔔', 50, N'BHsRgrW', N'https://imgur.com/BHsRgrW.jpg', N'醃蘿蔔是一道絕佳的開胃小菜，因為醃漬的緣故，使得它不僅保有蘿蔔的自然甜味，還帶有爽脆的口感，是一道清新可口的小菜，不僅可搭配主食，也能夠搭配清酒一起品嘗。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (5, 2, N'鮭魚生魚片', 250, N'e0nfG9Y', N'https://imgur.com/e0nfG9Y.jpg', N'嚴選新鮮的北大西洋鮭魚，富含Omega-3脂肪酸，建議搭配一杯清爽的清酒更具風味。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (6, 2, N'鮪魚生魚片', 220, N'wpfO1kQ', N'https://imgur.com/wpfO1kQ.jpg', N'嚴選新鮮的東港黑鮪魚，鮪魚生魚片以清新風味及淡雅油脂，形成對比鮭魚豐腴口感的獨特料理。建議搭配白葡萄酒更能突顯鮪魚的清新風味。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (7, 2, N'旗魚生魚片', 200, N'mWHZunO', N'https://imgur.com/mWHZunO.jpg', N'旗魚生魚片的質地緊密，肉質柔軟但不失嚼勁。相較於鮪魚，旗魚生魚片的低油脂含量更迎合追求健康口感的食客，成為那些希望品味海鮮同時注重健康的理想之選。建議搭配日本清酒更具風味', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (8, 2, N'天使紅蝦刺身', 200, N'eV3MY8N', N'https://imgur.com/eV3MY8N.jpg', N'嚴選最新鮮的天使紅蝦，確保每一隻都保持最佳狀態，這些嚼勁十足的紅蝦肉質充滿自然的甜味，品嚐時彷彿沉浸在海洋最純淨、最精緻的滋味中。這不僅是一道美味佳餚，更是我們對海洋鮮味極致的體現。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (9, 2, N'干貝刺身', 250, N'46Glgk2', N'https://imgur.com/46Glgk2.jpg', N'嚴選日本北海道生食級干貝。每顆干貝肉質細膩，入口即化，帶有淡淡的海洋甜味。建議搭配清酒更能突顯干貝的鮮甜風味。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (10, 4, N'唐揚炸雞', 280, N'j5dHLSQ', N'https://imgur.com/j5dHLSQ.jpg', N'採用新鮮、優質的雞肉，經過特殊的調味和處理，確保每一塊炸雞都有外酥內嫩的口感，吃起來香脆可口，再搭配獨特的秘製醬汁，帶有微辣和甜味，讓您一嚐就難以忘懷。這款唐揚炸雞是絕佳的居酒屋小吃，非常適合搭配各種啤酒、清酒或其他您喜愛的酒品。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (11, 4, N'炸天婦羅', 120, N'jNuhksI', N'https://imgur.com/jNuhksI.jpg', N'精心挑選新鮮的蔬菜，製作成豐富多彩的蔬菜天婦羅，蔬菜包裹著特製的麵衣，再經油炸處理，確保外層酥脆，每一口都能品嚐到不同的口感和風味。蔬菜天婦羅是一道絕佳的素食選擇，即使不吃肉的顧客也能盡情品味美味。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (12, 4, N'炸雞軟骨', 150, N'FfIimJV', N'https://imgur.com/FfIimJV.jpg', N'選用新鮮、優質的雞軟骨，雞軟骨經過獨特的調味和麵衣裹覆，再經過恰到好處的油炸，搭配著我們獨特的調味料，讓炸雞軟骨帶有微咸的風味。不僅可以當作美味的開胃菜，也是絕佳的啤酒、清酒的下酒菜，讓您在小酌時能夠有更多風味的體驗。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (13, 4, N'炸牡蠣', 220, N'hEFVKbO', N'https://imgur.com/hEFVKbO.jpg', N'新鮮的牡蠣質地鮮嫩，我們確保每一顆生牡蠣都是在最新鮮的狀態下搭配特殊調製的麵衣，油炸後呈現金黃酥脆的外皮，並且保持了炸牡蠣內部的鮮嫩。搭配著我們提供的調味料和醬汁，炸牡蠣是絕佳的啤酒小吃，搭配一杯冰涼的啤酒，讓您在用餐時感受愉悅的氛圍。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (14, 4, N'炸蝦', 250, N'oSPeRsj', N'https://imgur.com/oSPeRsj.jpg', N'精心挑選新鮮、優質的草蝦，確保每一隻都是最新鮮的狀態，經過特殊的麵衣裹覆，再經油炸處理，使外皮酥脆呈現金黃色的色澤，確保每一口都能夠品嚐到酥脆的口感，也可以搭配我們提供的醬汁，享受不同風味的體驗。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (15, 3, N'軟殼蟹手卷', 100, N'5j06NjY', N'https://imgur.com/5j06NjY.jpg', N'使用新鮮且優質的軟殼蟹，確保每一口手卷都能品味到蟹肉的鮮美和軟殼的脆嫩口感。軟殼蟹手卷以簡單而美味的搭配為特色，主要材料包括軟殼蟹、新鮮的生菜、日式米飯，搭配特製的醬汁，味道清新怡人。軟殼蟹手卷會以現點現做的方式來保證新鮮度，讓您在品嘗時能夠享受到最新鮮的滋味', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (16, 3, N'鮭魚卵手卷', 120, N'AbtAbyk', N'https://imgur.com/AbtAbyk.jpg', N'選用新鮮、優質的鮭魚卵，確保每一顆魚卵都保持著豐富的魚膠感和新鮮的海洋風味。鮭魚卵手卷會搭配著嫩滑的日式米飯，米飯的蓬鬆和卵的爽滑相互輝映，形成美妙的口感組合。我們也會提供芥末和醬油，以滿足您對風味的個人偏好。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (17, 1, N'韓式泡菜', 50, N'V7R7b9C', N'https://imgur.com/V7R7b9C.jpg', N'韓式泡菜可以搭配主食，如米飯或炸物，也可以作為副菜搭配您喜愛的酒品，提升用餐的樂趣。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (18, 3, N'海膽手卷', 120, N'kzOpwR2', N'https://imgur.com/kzOpwR2.jpg', N'以最新鮮的澎湖海膽為主要食材，手卷中搭配了嫩滑的日式米飯、新鮮的海苔以及一些蔬菜，海膽的鮮味透過搭配其他食材，形成了一種獨特而美味的滋味，令人回味無窮。', 1, 1)
GO
