INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (20, 3, N'干貝手卷', 90, N'lcYCWc7', N'https://imgur.com/lcYCWc7.jpg', N'精心挑選新鮮、優質的干貝，手卷中搭配了嫩滑的日式米飯、新鮮的海苔以及一些蔬菜，每一顆干貝經過廚師精準的烹調，有如裹上了一層金黃色的外衣，內裡的肉質柔軟鮮甜，也可以搭配我們提供的Wasabi和醬油，為干貝手卷增添更多的層次感。', 1, 1)
