INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (21, 4, N'日式炸豬排', 180, N'nGlyciW', N'https://imgur.com/nGlyciW.jpg', N'採用新鮮且優質的豬里肌肉，每一份里肌肉透過獨特醬料的醃製和特製麵衣的裹覆，油炸後仍能保持外酥內嫩的口感，使得每一片都能夠吃到香脆的外皮和多汁的內部。炸豬排可以沾附我們提供的獨特醬汁，再搭配一杯冰涼的日本啤酒或清酒，可以展現更豐富的美味。', 1, 1)
