INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (22, 5, N'烤秋刀魚', 80, N'np3QjzJ', N'https://imgur.com/np3QjzJ.jpg', N'以新鮮、高品質的秋刀魚為基礎，確保每一條秋刀魚都有最新鮮的海洋風味和鮮嫩的肉質。透過廚師精湛的烹飪將秋刀魚烤到外酥內嫩，每一份秋刀魚上桌時都能讓您品嚐到最佳的口感。烤秋刀魚特別適合搭配清酒或啤酒一起品嚐，將食材的美味提升到另一個層次。', 1, 1)
