INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (23, 5, N'烤烏魚子', 150, N'2NoctgU', N'https://imgur.com/2NoctgU.jpg', N'選用新鮮且高品質的烏魚子，確保每一粒都擁有濃郁的魚膠感和豐富的海洋風味。經過特殊的烘烤處理，使其表面微焦、內部保持鮮嫩。烤烏魚子搭配清酒或啤酒，能夠更好地品味烏魚子的鮮美，同時陶冶一番味蕾。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (24, 5, N'烤鮭魚頭', 300, N'6NoU4EM', N'https://imgur.com/6NoU4EM.jpg', N'精心挑選新鮮的鮭魚頭，確保每一個部位都保持著豐潤的肉質和濃郁的鮭魚風味。經過獨特的燒烤處理，外皮烤得酥脆，內部肉質嫩滑，確保每一口都能夠保持鮮美的口感。我們提供精心調製的特製醬汁，可以根據您的口味選擇，搭配鮭魚頭，增添風味層次。烤鮭魚頭特別適合搭配日本清酒，讓您在用餐時品味到獨特的日式風味。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (25, 5, N'烤中卷', 250, N'vUxslHP', N'https://imgur.com/vUxslHP.jpg', N'選用優質的鮮活中卷，廚師採用簡單而精湛的烹調技術，讓中卷保持其自然的鮮味，不掩蓋食材的原有風味。在品嚐烤中卷時，您可以根據個人喜好搭配我們提供的特製醬汁，增添層次感和風味。烤中卷是絕佳的啤酒小吃，搭配一杯冰涼的啤酒，讓您在用餐時感受到愉悅的氛圍。', 1, 1)
