INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (26, 5, N'烤伊比利豬肋條', 280, N'db9WA2x', N'https://imgur.com/db9WA2x.jpg', N'以頂級的伊比利豬肉為主要材料，伊比利豬肉以其鮮嫩的口感和大理石紋般的油花而聞名。每一份烤伊比利豬肋條在烤製的過程中會吸收沾附的獨特調味料和秘製醬汁，透過廚師精湛的廚藝確保肉質保持多汁且表皮烤得酥脆。上菜前會以適中的長度切割，方便品嚐的同時也展現出伊比利豬肉的獨特風味。伊比利豬肋條非常適合搭配各種酒品，包括啤酒、清酒，提升品嚐時的風味。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (27, 5, N'烤牛舌', 200, N'3qG6Hfz', N'https://imgur.com/3qG6Hfz.jpg', N'使用優質的牛舌，選用上等部位，保證肉質鮮嫩，經過特製的調味，搭配著日式燒烤的技巧，讓牛舌表面烤得微焦香脆，內部保持嫩滑，保留肉質的原汁原味。烤牛舌非常適合搭配各種啤酒、清酒或其他您喜歡的酒品，提升用餐體驗。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (28, 5, N'烤骰子牛', 180, N'BQ91Sgl', N'https://imgur.com/BQ91Sgl.jpg', N'精心挑選優質的澳洲牛肉，特別選用適合烤肉的牛肩夾部位，以確保口感豐富且肉質鮮嫩。透過廚師精湛的燒烤技術，保證每一顆的骰子牛肉質柔軟但不失嚼勁，每一塊都是熱騰騰的美味。我們提供多種調料味如黑胡椒、胡椒等，滿足不同口味的客人需求。', 1, 1)
