INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (29, 5, N'烤無骨雞腿', 200, N'kb2e0xD', N'https://imgur.com/kb2e0xD.jpg', N'以優質的雞肉為基礎，挑選去骨的雞腿肉，使用獨特的調味料和香草混合，使雞腿肉吸收豐富的風味，烤製過程中廚師會，確保雞腿肉烤得外焦內嫩，表皮香脆，內部保持多汁，使烤製過後的烤無骨雞腿散發出的香氣令人垂涎欲指。', 1, 1)
