INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (30, 5, N'炙燒干貝', 200, N'Y2P6bXj', N'https://imgur.com/Y2P6bXj.jpg', N'嚴選日本北海道生食級干貝。每顆干貝肉質細膩，入口即化，帶有淡淡的海洋甜味。透過廚師獨特的炙燒技法，輕輕烤過干貝表面，保留了干貝的嫩滑口感，同時帶來淡淡的炭烤香氣。炙燒干貝可以搭配我們精心調製的特製醬汁，使得每一口都充滿豐富的風味。這道炙燒干貝非常適合搭配清酒、威士忌或其他您喜愛的酒品，為您的用餐體驗增添一份風味。', 1, 1)
