INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (31, 5, N'花魚一夜干', 280, N'Ro8rvlH', N'https://imgur.com/Ro8rvlH.jpg', N'精心挑選新鮮的花魚，確保每一條都是品質上乘的花魚，有著細嫩的肉質和豐富的鮮味。經過廚師的烘烤技術後，形成花魚一夜干的獨特風味，既有淡淡的海味，又帶有烘烤後的香氣，是一款非常適合搭配酒類的美味菜餚。', 1, 1)
