INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (32, 5, N'烤鯖魚', 180, N'34flnt2', N'https://imgur.com/34flnt2.jpg', N'選用優質的新鮮鯖魚，確保每一條鯖魚肉都擁有最鮮美的味道。廚師注重烹飪的每一個細節，讓鯖魚保持其自然的鮮味，不掩蓋食材的原有風味。在品嚐烤鯖魚時，您可以根據個人喜好搭配我們提供的獨特調味料。烤鯖魚是絕佳的清酒小吃，搭配一杯冷冽的清酒，能夠更好地品味出鯖魚的風味。', 1, 1)
