INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (33, 6, N'烤牛肉串', 90, N'TRzJJcz', N'https://imgur.com/TRzJJcz.jpg', N'我們選用上等牛五花肉，經過精心醃製，再以炭火慢烤而成。牛肉外焦里嫩，肉汁豐盈，散發著濃郁的炭火香氣。在醃製牛肉時，我們使用了醬油、米酒、蔥等多種香料，讓牛肉充分入味。目前有兩種口味可供選擇：原味和孜然味。原味可以品嚐到牛肉本身的鮮甜滋味，而孜然味則帶有濃郁的孜然香氣。烤牛肉串是非常適合搭配啤酒或清酒享用。如果您是第一次來我們店，一定不要錯過這道招牌料理。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (34, 6, N'烤豬肉串', 90, N'WJ3dJW9', N'https://imgur.com/WJ3dJW9.jpg', N'我們的烤豬肉串選用新鮮的豬五花肉，經過精心醃製，再用炭火慢烤而成。豬五花肉肥瘦相間，經過醃製後更加香嫩入味。炭火的香氣充分融入肉中，讓烤豬肉串外焦裡嫩，香氣四溢。目前提供兩種口味的烤豬肉串：原味和孜然味。原味可以品嚐到豬肉的原始鮮甜滋味。孜然味則帶有濃郁的孜然香氣，讓人回味無窮。烤豬肉串是本店的拿手料理，也是下酒菜的最佳選擇。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (35, 6, N'烤雞肉串', 90, N'iN7H8z9', N'https://i.imgur.com/iN7H8z9.jpg', N'烤雞肉串的食材選用新鮮的雞肉，經過我們獨門醬汁的醃製，再用炭火慢慢烤制而成，經由經驗豐富的廚師精心烤制，烤好的雞肉串外焦裡嫩，香氣四溢。烤雞肉串可以直接食用，也可以搭配蘸醬食用，目前提供的蘸醬有照燒醬、鹽燒醬、醬烤醬、柚子胡椒醬等。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (36, 6, N'烤雞翅串', 90, N'MYprJwB', N'https://imgur.com/MYprJwB.jpg', N'我們的烤雞翅串選用新鮮的雞翅，經過獨特的醃製手法，再以炭火慢烤而成。烤好的雞翅串外焦裡嫩，香氣撲鼻。雞肉鮮嫩多汁，帶著淡淡的炭火香氣。烤雞翅串是一道非常適合下酒的菜餚。搭配一杯清爽的啤酒，或是溫熱的清酒，更能襯托出烤雞翅串的美味。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (37, 5, N'烤棉花糖', 50, N'DINMMYZ', N'https://imgur.com/DINMMYZ.jpg', N'烤棉花糖是一道非常受歡迎的甜點，尤其是小朋友都很喜歡。我們的烤棉花糖選用的是美國進口的棉花糖，口感綿密，入口即化。我們會將棉花糖烤至外層焦香，內裡柔軟，再搭配煉乳、巧克力醬或水果等配料，讓您享受到豐富的美味。烤棉花糖不僅美味，而且形狀就像一朵雲，象徵著夢想和希望。我們希望每位客人來到我們的居酒屋，都能夠享受到美好的時光，並帶著夢想和希望離開。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (38, 5, N'烤麻吉', 50, N'2CwNz5e', N'https://imgur.com/2CwNz5e.jpg', N'麻糬由糯米製成，口感軟糯香甜，我們將麻糬切成小塊，放在烤爐上烤至表面金黃，使得烤麻吉外焦裡嫩，口感Q彈。它可以搭配各種醬料，如黃豆粉、煉乳、巧克力醬等。也可以搭配冰淇淋或水果，一起享用。烤麻吉是一道老少咸宜的料理，在居酒屋裡非常受歡迎。它不僅美味可口，而且寓意吉祥。在日本，麻糬被認為是一種象徵著幸福和好運的食物。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (39, 6, N'烤櫛瓜串', 70, N'rSof0t4', N'https://imgur.com/rSof0t4.jpg', N'櫛瓜是一種營養豐富的蔬菜，富含維生素C、鉀、膳食纖維等營養成分。烤櫛瓜串是一道非常健康的料理，烤好的櫛瓜串，櫛瓜的清甜與醬汁的鹹香完美融合，讓人忍不住一口接一口。烤櫛瓜串是一道非常適合下酒的菜餚。搭配一杯清酒，更是別有一番風味。', 1, 1)
GO
