INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (41, 5, N'烤玉米筍', 70, N'fSgdOEG', N'https://imgur.com/fSgdOEG.jpg', N'我們的烤玉米筍選用新鮮的台灣玉米筍，經過精心挑選，只選用最嫩、最甜的玉米筍。採用炭火烤制，將玉米筍的鮮甜滋味完全激發出來。咬上一口烤好的玉米筍，玉米筍的汁水在口中爆開，甜而不膩，讓人回味無窮。

烤玉米筍不僅美味，而且營養豐富。玉米筍富含蛋白質、維生素、礦物質等營養成分，具有健脾開胃、助消化等功效。', 1, 1)
GO
