INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (43, 7, N'味噌湯', 40, N'hizFaiX', N'https://imgur.com/hizFaiX.jpg', N'我們的味噌湯是使用北海道產的味噌，搭配新鮮的豆腐、蔬菜和海帶熬煮而成。味噌湯的味道濃郁，湯頭鮮美，是居酒屋必備的經典料理。味噌湯的營養價值豐富，含有豐富的蛋白質、維生素和礦物質。味噌中的大豆蛋白質容易被人體吸收，有助於增強體力。味噌湯中的維生素和礦物質也有助於維持身體健康。我們居酒屋的味噌湯，是使用新鮮的食材和精心熬煮的湯頭，味道濃郁，營養豐富。歡迎大家來品嚐。', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (44, 7, N'薑絲蛤蜊湯', 80, N'uhwcJBi', N'https://imgur.com/uhwcJBi.jpg', N'各位客官，來碗薑絲蛤蜊湯暖暖胃吧！我們選用新鮮的蛤蜊，搭配薑絲和米酒，清蒸而成。蛤蜊肉質鮮嫩，湯頭鮮甜，薑絲去腥解膩，非常適合在寒冷的天氣享用。這道湯可是我們店裡的招牌菜，很多客人都指名要點。歡迎大家來嚐鮮！', 1, 1)
GO
INSERT [dbo].[Products] ([Id], [CategoryId], [Name], [UnitPrice], [Image], [ImageUrl], [Present], [DisplayOrder], [IsLaunched]) VALUES (45, 5, N'烤阿根廷紅蝦', 200, N'4L9HlDY', N'https://imgur.com/4L9HlDY.jpg', N'阿根廷紅蝦來自南美洲阿根廷南部海域，生長在水質純淨、無污染的深海中。牠們個頭大，色澤紅潤，肉質鮮嫩，口感Q彈，是蝦中極品。我們選用最新鮮的大尾蝦，經過簡單的烹調，就能完美呈現出牠的美味。蝦殼烤得酥脆，蝦肉鮮甜多汁，讓人忍不住一口接一口。這道菜非常適合搭配啤酒或清酒，是居酒屋必點的經典菜色。', 1, 1)
GO
